import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import state from './../Redux/State'

ReactDOM.render(
        <App TextData={state.TextData} DialogData={state.DialogData} PostData={state.PostData}/>,
    document.getElementById('root')
);

